import 'bootstrap/dist/css/bootstrap.min.css';

import React from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import './index.css'; 

const Nav_bar = () => {
    return(
        <Navbar expand='lg'>
            <Navbar.Brand>Ezeiyoke Cosmas</Navbar.Brand>
            <Navbar.Toggle/>
            <Navbar.Collapse>

                <Nav className='me-auto'>
                    <Nav.Link href='#'>Home</Nav.Link>
                    <Nav.Link href='#'>Instuctions</Nav.Link>

                </Nav>
            </Navbar.Collapse>
            </Navbar>
        
    );
}


const Bodycontent = () => {
    return(
        <div className='container question-cont'>
            <div className='row mb-4 question-row'>
                <div className='col-lg-12'>
                    <div><h3>Total Time</h3></div>
                    <div className='progress progress-rule' role='progressbar'></div>
                </div>
            
               
            <div className='row mb-2'>
              <div className='col-lg-12 question'>
              <h3>0/65</h3>
                <h6>The best database storage</h6>
                   <p className='options1'>rds</p>
                   <p className='options1'>dyamno</p>
                   <p className='options1'>auro</p>
                    <p className='options1'>athen</p>
            </div>
            </div>
                
            </div>

        </div>
    );
}


function App() {
    return(

        <div className='app'>

            <Nav_bar />
            <Bodycontent/>

        </div>

    )


}

export default App
